INSERT INTO `notices` (`id`, `uid`, `title`, `slug`, `content`, `excerpt`, `category`, `priority`, `attachment`, `attachment_name`, `start_date`, `end_date`, `target_audience`, `views`, `published`, `pinned`, `created_by`, `created_at`, `updated_at`) VALUES
(1, 'ed8a3b9f-e575-11f0-8f09-4f2ae6045ecf', 'Semester Registration Now Open', 'semester-registration-now-open', '<p>Registration for the upcoming semester is now open. All students are required to complete their registration by the deadline.</p><h3>Important Dates:</h3><ul><li>Registration Opens: January 15, 2025</li><li>Registration Closes: February 15, 2025</li><li>Late Registration: February 16-28, 2025 (with penalty)</li></ul>', 'Registration for the upcoming semester is now open. All students are required to complete their registration by the deadline.', 'Academic', 'high', NULL, NULL, NULL, NULL, 'students', 8, 1, 1, NULL, '2025-12-30 14:51:29', '2026-01-05 15:20:19'),
(2, 'ed8a526a-e575-11f0-8f09-4f2ae6045ecf', 'Library Hours Extended During Exams', 'library-hours-extended-exams', '<p>The main library will extend its operating hours during the examination period to support student study needs.</p><p><strong>Extended Hours:</strong> 6:00 AM - 12:00 AM (Midnight)</p><p><strong>Effective:</strong> During exam week</p>', 'The main library will extend its operating hours during the examination period.', 'Facilities', 'normal', NULL, NULL, NULL, NULL, 'all', 4, 1, 0, NULL, '2025-12-30 14:51:29', '2026-01-04 10:47:33'),
(3, 'ed8a5593-e575-11f0-8f09-4f2ae6045ecf', 'Campus Maintenance Notice', 'campus-maintenance-notice', '<p>Scheduled maintenance work will be carried out on the main building electrical systems this weekend.</p><p>Some areas may experience temporary power outages.</p>', 'Scheduled maintenance work will be carried out on the main building electrical systems this weekend.', 'General', 'normal', NULL, NULL, NULL, NULL, 'all', 2, 1, 0, NULL, '2025-12-30 14:51:29', '2026-01-04 11:07:35');
