INSERT INTO `notification_templates` (`id`, `uid`, `name`, `subject`, `body`, `body_html`, `category`, `variables`, `is_active`, `created_by`, `created_at`, `updated_at`) VALUES
(1, '6385a94f-e578-11f0-8f09-4f2ae6045ecf', 'Welcome Message', 'Welcome to {{institution_name}}', 'Dear {{recipient_name}},\n\nWelcome to {{institution_name}}! We are excited to have you join our community.\n\nBest regards,\n{{institution_name}} Team', '<p>Dear {{recipient_name}},</p><p>Welcome to <strong>{{institution_name}}</strong>! We are excited to have you join our community.</p><p>Best regards,<br>{{institution_name}} Team</p>', 'Welcome', '[\"recipient_name\", \"institution_name\"]', 1, NULL, '2025-12-30 15:09:06', '2025-12-30 15:09:06'),
(2, '6385bcf1-e578-11f0-8f09-4f2ae6045ecf', 'Event Reminder', 'Reminder: {{event_name}} on {{event_date}}', 'Dear {{recipient_name}},\n\nThis is a reminder that {{event_name}} is scheduled for {{event_date}} at {{event_time}}.\n\nLocation: {{event_location}}\n\nWe look forward to seeing you there!\n\nBest regards,\n{{institution_name}}', '<p>Dear {{recipient_name}},</p><p>This is a reminder that <strong>{{event_name}}</strong> is scheduled for {{event_date}} at {{event_time}}.</p><p><strong>Location:</strong> {{event_location}}</p><p>We look forward to seeing you there!</p><p>Best regards,<br>{{institution_name}}</p>', 'Events', '[\"recipient_name\", \"event_name\", \"event_date\", \"event_time\", \"event_location\", \"institution_name\"]', 1, NULL, '2025-12-30 15:09:06', '2025-12-30 15:09:06'),
(3, '6385bfcd-e578-11f0-8f09-4f2ae6045ecf', 'Exam Schedule', 'Examination Schedule - {{semester}}', 'Dear {{recipient_name}},\n\nThe examination schedule for {{semester}} has been released.\n\nPlease check the notice board or student portal for detailed timings.\n\nImportant: Bring your ID card to all examinations.\n\nBest regards,\nExamination Department', '<p>Dear {{recipient_name}},</p><p>The examination schedule for <strong>{{semester}}</strong> has been released.</p><p>Please check the notice board or student portal for detailed timings.</p><p><strong>Important:</strong> Bring your ID card to all examinations.</p><p>Best regards,<br>Examination Department</p>', 'Academic', '[\"recipient_name\", \"semester\"]', 1, NULL, '2025-12-30 15:09:06', '2025-12-30 15:09:06'),
(4, '6385c115-e578-11f0-8f09-4f2ae6045ecf', 'Fee Reminder', 'Fee Payment Reminder - Due Date: {{due_date}}', 'Dear {{recipient_name}},\n\nThis is a reminder that your fee payment of {{amount}} is due on {{due_date}}.\n\nPlease ensure timely payment to avoid late fees.\n\nFor any queries, contact the accounts department.\n\nBest regards,\nAccounts Department', '<p>Dear {{recipient_name}},</p><p>This is a reminder that your fee payment of <strong>{{amount}}</strong> is due on <strong>{{due_date}}</strong>.</p><p>Please ensure timely payment to avoid late fees.</p><p>For any queries, contact the accounts department.</p><p>Best regards,<br>Accounts Department</p>', 'Finance', '[\"recipient_name\", \"amount\", \"due_date\"]', 1, NULL, '2025-12-30 15:09:06', '2025-12-30 15:09:06'),
(5, '6385c21e-e578-11f0-8f09-4f2ae6045ecf', 'Holiday Notice', 'Holiday Notice - {{holiday_name}}', 'Dear All,\n\nPlease note that the institution will remain closed on {{holiday_date}} on account of {{holiday_name}}.\n\nRegular classes/work will resume on {{resume_date}}.\n\nBest regards,\n{{institution_name}}', '<p>Dear All,</p><p>Please note that the institution will remain closed on <strong>{{holiday_date}}</strong> on account of <strong>{{holiday_name}}</strong>.</p><p>Regular classes/work will resume on {{resume_date}}.</p><p>Best regards,<br>{{institution_name}}</p>', 'General', '[\"holiday_name\", \"holiday_date\", \"resume_date\", \"institution_name\"]', 1, NULL, '2025-12-30 15:09:06', '2025-12-30 15:09:06'),
(6, '6385c31c-e578-11f0-8f09-4f2ae6045ecf', 'Emergency Alert', 'URGENT: {{alert_title}}', 'URGENT NOTICE\n\n{{alert_message}}\n\nPlease follow all instructions and stay safe.\n\nFor emergencies, contact: {{emergency_contact}}\n\n{{institution_name}} Administration', '<p style=\"color: red; font-weight: bold;\">URGENT NOTICE</p><p>{{alert_message}}</p><p>Please follow all instructions and stay safe.</p><p><strong>For emergencies, contact:</strong> {{emergency_contact}}</p><p>{{institution_name}} Administration</p>', 'Emergency', '[\"alert_title\", \"alert_message\", \"emergency_contact\", \"institution_name\"]', 1, NULL, '2025-12-30 15:09:06', '2025-12-30 15:09:06');
