INSERT INTO `package_itinerary` (`id`, `uid`, `package_id`, `day_number`, `title`, `description`, `meals`, `accommodation`, `distance`, `activities`, `sort_order`, `created_at`) VALUES
(1, 'a41b-3ba8-b8e3', 1, 0, 'Arrival in Arusha', 'Arrival at Kilimanjaro Airport. Meet your guide and transfer to your hotel in Arusha. Briefing about your upcoming safari adventure.', 'D', 'Arusha Lodge', NULL, NULL, 0, '2025-12-05 09:11:30'),
(2, '450b-fc70-5ed5', 1, 1, 'Arusha - Serengeti National Park', 'Early morning departure for Serengeti via Ngorongoro. Game drive en route through the conservation area. Picnic lunch and afternoon game drive in Serengeti.', 'B,L,D', 'Serengeti Camp', NULL, NULL, 1, '2025-12-05 09:11:30'),
(3, '60ea-de7a-2b6d', 1, 2, 'Full Day Serengeti', 'Full day exploring Serengeti\'s vast plains. Morning and afternoon game drives with picnic lunch. Look for lions, leopards, elephants, and more.', 'B,L,D', 'Serengeti Camp', NULL, NULL, 2, '2025-12-05 09:11:30'),
(4, 'ca64-48be-5076', 1, 3, 'Serengeti - Ngorongoro', 'Morning game drive in Serengeti, then drive to Ngorongoro Conservation Area. Arrive at crater rim lodge for stunning views.', 'B,L,D', 'Ngorongoro Lodge', NULL, NULL, 3, '2025-12-05 09:11:30'),
(5, '9307-c81d-3663', 1, 4, 'Ngorongoro Crater - Arusha', 'Descend into the crater for a half-day safari. Spot rhinos, hippos, and flamingos. After lunch, drive back to Arusha or airport.', 'B,L', '-', NULL, NULL, 4, '2025-12-05 09:11:30'),
(6, '5d16-a016-92ad', 2, 0, 'Arrival Day', 'Your 6-day safari adventure commences with your arrival in Arusha. Welcome at Kilimanjaro Airport and introduction to your guide.', 'D', 'Lodge in Arusha', NULL, NULL, 0, '2025-12-05 09:11:30'),
(7, '202b-8413-2068', 2, 1, 'Arusha - Serengeti National Park', 'Early morning drive to Serengeti via Ngorongoro. Game drive en route. Upon entering Serengeti, enjoy afternoon game drive.', 'B,L,D', 'Serengeti Camp', NULL, NULL, 1, '2025-12-05 09:11:30'),
