(20, '8549-4369-8f5a', 1, 0, 'Arrival Day', 'Your 5-day safari adventure commences with your arrival in Arusha. You\'ll be welcomed at Kilimanjaro Airport and introduced to your guide, who will accompany you throughout the journey. After a brief orientation, you\'ll embark on a scenic drive to Tarangire National Park, known for its incredible wildlife diversity. The landscape is a photographer\'s dream, and you\'ll have your first game drive in search of the Big Five. Later, you\'ll enjoy a delightful picnic lunch near the Tarangire River, offering picturesque views of the surrounding wildlife. Following your explorations, you\'ll exit the park around 4:30 pm and head to your comfortable lodge nestled within the park. Dinner and an overnight stay at the lodge await.', 'D', 'Tarangire Lodge', NULL, NULL, 0, '2025-12-05 09:47:24'),
(21, '7e00-68e7-19c9', 1, 1, 'Tarangire to Lake Manyara National Park', 'After a rejuvenating night\'s rest and a hearty breakfast, your journey takes you to Lake Manyara National Park. This park is renowned for its tree-climbing lions and the vast array of birdlife surrounding the lake. As you embark on a thrilling game drive, be on the lookout for these unique predators and the stunning flamingos that inhabit the area. The park offers a rich mix of wildlife, including hippos, buffaloes, and countless bird species. After a fulfilling day, you\'ll return to your comfortable lodge near the park, where you\'ll enjoy a delightful dinner and rest for the night.', 'B,L,D', 'Lake Manyara Lodge', NULL, NULL, 1, '2025-12-05 09:47:24'),
(22, 'd254-c324-aabf', 1, 2, 'Lake Manyara to Serengeti National Park', 'The next leg of your adventure leads you to the world-famous Serengeti National Park. En route, you\'ll engage in a game drive, allowing you to experience the local wildlife. You\'ll make your way to the heart of the Serengeti, where you\'ll spend the night within the park. This strategic location offers you incredible opportunities to explore the park\'s diverse landscapes and encounter its magnificent wildlife.', 'B,L,D', 'Serengeti Camp', NULL, NULL, 2, '2025-12-05 09:47:24'),
(23, '9c6c-0008-2628', 1, 3, 'Full Day in the Serengeti', 'Today is dedicated to fully immerse yourself in the magic of the Serengeti. Your expert guide will lead you through the park\'s diverse ecosystems, in search of the Big Five and the Great Migration, depending on the season. A picnic lunch amid the wilderness adds to the adventure. As the day unfolds, you\'ll return to your camp for an authentic bush dinner, surrounded by the sights and sounds of the untamed Serengeti.', 'B,L,D', 'Serengeti Camp', NULL, NULL, 3, '2025-12-05 09:47:24'),
(24, 'f1e6-981f-15d1', 1, 4, 'Serengeti to Ngorongoro Crater - Return to Airport', 'Your safari adventure enters its final chapter as you head towards the Ngorongoro Crater, a UNESCO World Heritage Site. Descending into the crater, you\'ll embark on an extraordinary game drive, seeking black rhinos and a multitude of other species that call this area home. A scenic picnic lunch within the crater adds to the experience. After your visit, you\'ll ascend and begin your journey back to Arusha, where you\'ll bid farewell to your unforgettable safari adventure.', 'B,L', '-', NULL, NULL, 4, '2025-12-05 09:47:24'),
(25, 'f712-1c5d-351c', 2, 0, 'Arrival Day', 'Your 6-day safari adventure commences with your arrival in Arusha. You\'ll be welcomed at Kilimanjaro Airport and introduced to your guide, who will accompany you throughout the journey. After a brief orientation, you\'ll have time to rest and prepare for the upcoming safari. Dinner and overnight at the lodge.', 'D', 'Lodge in Arusha', NULL, NULL, 0, '2025-12-05 09:47:24'),
(26, '723a-3eb4-61e4', 2, 1, 'Arusha - Serengeti National Park', 'Early morning drive to Serengeti via Ngorongoro. Game drive en route. Upon entering Serengeti, enjoy afternoon game drive and overnight at the camp.', 'B,L,D', 'Serengeti Camp', NULL, NULL, 1, '2025-12-05 09:47:24'),
(27, '2c0f-8838-5242', 2, 2, 'Full Day Game Drive in Serengeti', 'Full day exploring the vast Serengeti plains. Spot wildebeests, zebras, lions, and leopards. Picnic lunch in the park with amazing views. Return to camp for dinner.', 'B,L,D', 'Serengeti Camp', NULL, NULL, 2, '2025-12-05 09:47:24'),
(28, '99a0-e964-b8ab', 2, 3, 'Serengeti - Central Serengeti', 'Morning game drive, then head to central Serengeti. More game viewing opportunities and stunning landscapes. Picnic lunch and return to camp.', 'B,L,D', 'Central Serengeti Camp', NULL, NULL, 3, '2025-12-05 09:47:24'),
(29, '57b6-9cbb-c983', 2, 4, 'Serengeti - Ngorongoro Crater', 'Depart Serengeti with game drive en route. Arrive at Ngorongoro Crater rim for stunning sunset views. Dinner and overnight at crater rim lodge.', 'B,L,D', 'Ngorongoro Lodge', NULL, NULL, 4, '2025-12-05 09:47:24'),
(30, '429e-b4ee-b4d2', 2, 5, 'Ngorongoro Crater - Karatu', 'Descend into the crater for a full day safari. Spot rhinos, hippos, flamingos, and more. A scenic picnic lunch within the crater provides spectacular views. In the afternoon, drive to Karatu for dinner and rest.', 'B,L,D', 'Karatu Lodge', NULL, NULL, 5, '2025-12-05 09:47:24'),
(31, 'dffe-619b-b11f', 2, 6, 'Karatu - Arusha', 'After breakfast, drive back to Arusha. Drop-off at hotel or Kilimanjaro Airport. End of your unforgettable safari adventure.', 'B', '-', NULL, NULL, 6, '2025-12-05 09:47:24'),
(32, 'cf4d-ced3-d3de', 3, 0, 'Arrival Day', 'Your adventure begins as you arrive in Arusha, Tanzania. You\'ll be greeted at the airport and transferred to your comfortable accommodation to relax and prepare for the upcoming safari.', 'D', 'Arusha Hotel', NULL, NULL, 0, '2025-12-05 09:47:24'),
(33, 'c631-b13c-df96', 3, 1, 'Arusha - Lake Manyara National Park', 'After breakfast, you\'ll set out for Lake Manyara National Park, famous for its diverse birdlife, tree-climbing lions, and breathtaking landscapes. Enjoy a game drive and discover the park\'s rich wildlife, then head to your lodge for dinner and an overnight stay.', 'B,L,D', 'Lake Manyara Lodge', NULL, NULL, 1, '2025-12-05 09:47:24'),
(34, 'adfc-0685-b099', 3, 2, 'Lake Manyara - Serengeti National Park', 'You\'ll depart Lake Manyara and journey to Serengeti National Park. En route, you\'ll explore the Ngorongoro Conservation Area, encountering more wildlife. Upon entering the Serengeti, your game drive will unveil the park\'s incredible biodiversity. Later, you\'ll reach your Serengeti campsite for dinner and an overnight stay.', 'B,L,D', 'Serengeti Camp', NULL, NULL, 2, '2025-12-05 09:47:24'),
(35, '1ad9-a869-461a', 3, 3, 'Full Day in the Serengeti', 'A whole day in the Serengeti is dedicated to witnessing its remarkable wildlife. The park is renowned for its herds of wildebeests and zebras during the great migration. You\'ll have multiple game drives to spot the Big Five and various other species. Enjoy a picnic lunch within the park before returning to your campsite for dinner.', 'B,L,D', 'Serengeti Camp', NULL, NULL, 3, '2025-12-05 09:47:24'),
(36, 'b5d1-a875-ad77', 3, 4, 'Serengeti National Park', 'Your exploration of the Serengeti continues, with morning and afternoon game drives. The Serengeti\'s diverse landscapes provide endless wildlife viewing opportunities. In the late afternoon, you\'ll return to your campsite for relaxation and dinner.', 'B,L,D', 'Serengeti Camp', NULL, NULL, 4, '2025-12-05 09:47:24'),
(37, 'a2ac-a937-962c', 3, 5, 'Serengeti - Ngorongoro Crater', 'Departing the Serengeti, you\'ll travel to the Ngorongoro Crater. Enjoy a game drive en route and ascend to the crater\'s rim. Dinner and an overnight stay will be at your campsite in the Ngorongoro Conservation Area.', 'B,L,D', 'Ngorongoro Lodge', NULL, NULL, 5, '2025-12-05 09:47:24'),
(38, '4d7c-e9dd-cd38', 3, 6, 'Ngorongoro Crater - Karatu', 'Today, you\'ll descend into the Ngorongoro Crater, a UNESCO World Heritage Site. The crater\'s floor is home to a multitude of wildlife, including the Big Five. A picnic lunch within the crater provides spectacular views. In the afternoon, you\'ll drive to Karatu, a scenic highland town, for dinner and a comfortable night\'s rest.', 'B,L,D', 'Karatu Lodge', NULL, NULL, 6, '2025-12-05 09:47:24'),
(39, '4617-06f6-7a8d', 3, 7, 'Karatu - Arusha', 'Your final day brings you back to Arusha. Enjoy the morning in Karatu, then journey back to Arusha, arriving for lunch or transferring to Kilimanjaro International Airport for your onward travel.', 'B,L', '-', NULL, NULL, 7, '2025-12-05 09:47:24'),
(40, '6bce-e2ce-32d6', 4, 0, 'Arrival in Arusha', 'Welcome to Tanzania! You\'ll be greeted at Kilimanjaro Airport and transferred to your accommodation. Rest and prepare for your combined safari and beach adventure.', 'D', 'Arusha Hotel', NULL, NULL, 0, '2025-12-05 09:47:24'),
(41, '5d70-f92b-b33f', 4, 1, 'Arusha - Tarangire National Park', 'Drive to Tarangire National Park, famous for its large elephant herds and scenic baobab trees. Enjoy your first game drive in search of the Big Five and other wildlife.', 'B,L,D', 'Tarangire Lodge', NULL, NULL, 1, '2025-12-05 09:47:24'),
(42, '40ef-8e8d-60ab', 4, 2, 'Tarangire - Lake Manyara', 'Morning game drive in Tarangire, then proceed to Lake Manyara National Park. This park is famous for its tree-climbing lions and abundant birdlife. Afternoon game drive and overnight stay.', 'B,L,D', 'Lake Manyara Lodge', NULL, NULL, 2, '2025-12-05 09:47:24'),
