(84, 'aee7-2c55-78a3', 9, 1, 'Machame Gate to Machame Camp', 'Start your Kilimanjaro adventure! Trek from Machame Gate (1,800m) through lush forests to Machame Camp (2,985m). Distance: 11km. Acclimatization day.', 'B,L,D', 'Machame Camp', NULL, NULL, 1, '2025-12-05 09:47:24'),
