(87, '5466-b8a8-918d', 9, 4, 'Barranco to Karanga Camp', 'Trek up the famous Barranco Wall, then across high altitude desert to Karanga Camp (4,035m). Distance: 5km. High altitude acclimatization.', 'B,L,D', 'Karanga Camp', NULL, NULL, 4, '2025-12-05 09:47:24'),
(88, '03bc-90c3-03f6', 9, 5, 'Karanga to Barafu Camp', 'Trek from Karanga Camp to Barafu Camp (4,640m). Distance: 4km. Rest day for final summit acclimatization.', 'B,L,D', 'Barafu Camp', NULL, NULL, 5, '2025-12-05 09:47:24'),
(89, 'bdf0-9381-07ef', 9, 6, 'Summit Night - Uhuru Peak', 'Early morning departure (midnight) for summit attempt. Trek to Uhuru Peak (5,895m), the roof of Africa! Descent to Mweka Camp (3,100m). Distance: 12km up, 12km down.', 'B,L,D', 'Mweka Camp', NULL, NULL, 6, '2025-12-05 09:47:24'),
(90, 'c890-8a58-b987', 9, 7, 'Mweka Gate - Moshi', 'Final trek from Mweka Camp through rainforest to Mweka Gate (1,640m). Distance: 10km. Transfer back to Moshi. Celebrate your achievement!', 'B,L', '-', NULL, NULL, 7, '2025-12-05 09:47:24');
