INSERT INTO `pages` (`id`, `uid`, `title`, `slug`, `content`, `excerpt`, `featured_image`, `seo_title`, `seo_description`, `seo_keywords`, `template`, `theme`, `status`, `sort_order`, `show_in_footer`, `show_in_header`, `created_at`, `updated_at`) VALUES
(1, '2a1a8495-d29b-46d8-a295-640e45d3a7ec', 'Terms & Conditions', 'terms-conditions', '<h2>Terms of Use</h2><p>Welcome to Osiram Safari Adventure. By accessing and using our website and services, you agree to comply with and be bound by the following terms and conditions.</p><h3>1. Booking Terms</h3><p>All bookings are subject to availability and confirmation. A deposit may be required to secure your booking. Full payment terms will be provided at the time of booking.</p><h3>2. Cancellation Policy</h3><p>Please refer to our separate Cancellation Policy page for detailed information about cancellations, refunds, and changes to bookings.</p><h3>3. Travel Insurance</h3><p>We strongly recommend that all travelers obtain comprehensive travel insurance before their trip. This should cover trip cancellation, medical emergencies, and personal belongings.</p><h3>4. Liability</h3><p>Sweet and Conrad Tours acts as an agent for various service providers including hotels, airlines, and activity operators. We are not liable for any loss, damage, injury, or delay caused by these third-party providers.</p><h3>5. Passport and Visa</h3><p>It is the responsibility of each traveler to ensure they have valid travel documents, including passports and any required visas for their destination.</p><h3>6. Changes to Itinerary</h3><p>We reserve the right to make changes to itineraries when necessary due to weather conditions, safety concerns, or other circumstances beyond our control.</p>', 'Read our terms and conditions for using Sweet and Conrad Tours services.', '071436d9085d9f437ccb3e8a9abbff73.jpg', 'Terms & Conditions | Osiram Safari Adventure', 'Terms and conditions for booking safari tours and travel services with Osiram Safari Adventure.', 'terms conditions, booking terms, safari terms, travel agreement', 'default', 'tourism', 'published', 1, 1, 0, '2025-12-08 07:43:18', '2026-01-02 09:44:32'),
(2, '216e417e-649f-4854-ac62-384272927ad2', 'Privacy Policy', 'privacy-policy', '<h2>Privacy Policy</h2><p>Osiram Safari Adventure is committed to protecting your privacy. This policy explains how we collect, use, and safeguard your personal information.</p><h3>1. Information We Collect</h3><p>We collect information you provide directly to us, such as:</p><ul><li>Name and contact information</li><li>Passport details (for booking purposes)</li><li>Payment information</li><li>Travel preferences and requirements</li><li>Communication history</li></ul><h3>2. How We Use Your Information</h3><p>We use the information we collect to:</p><ul><li>Process and manage your bookings</li><li>Communicate with you about your travel arrangements</li><li>Send you marketing communications (with your consent)</li><li>Improve our services</li><li>Comply with legal obligations</li></ul><h3>3. Information Sharing</h3><p>We share your information with third-party service providers such as hotels, airlines, and tour operators as necessary to fulfill your booking. We do not sell your personal information to third parties.</p><h3>4. Data Security</h3><p>We implement appropriate security measures to protect your personal information from unauthorized access, alteration, or disclosure.</p><h3>5. Your Rights</h3><p>You have the right to access, correct, or delete your personal information. Contact us to exercise these rights.</p><h3>6. Contact Us</h3><p>If you have any questions about this Privacy Policy, please contact us at privacy@osiramsafari.com</p>', 'Learn how we collect, use, and protect your personal information.', NULL, 'Privacy Policy', 'Our privacy policy explains how Osiram Safari Adventure collects, uses, and protects your personal data.', 'privacy policy, data protection, personal information, GDPR', 'default', 'tourism', 'published', 2, 1, 0, '2025-12-08 07:43:18', '2026-01-02 09:44:32'),
(4, '0cb95e78-55df-4224-83c2-5131eae51f0b', 'Frequently Asked Questions', 'faq', '<h2>Frequently Asked Questions</h2><h3>Booking &amp; Payments</h3><h4>How do I book a safari?</h4><p>You can book online through our website, send us an enquiry form, or contact us directly via email or phone. Our team will help you customize the perfect safari experience.</p><h4>What payment methods do you accept?</h4><p>We accept bank transfers, credit cards (Visa, MasterCard), and mobile money payments. A deposit is required to confirm your booking.</p><h4>Is travel insurance required?</h4><p>While not mandatory, we strongly recommend comprehensive travel insurance that covers trip cancellation, medical emergencies, and evacuation.</p><h3>Safari Experience</h3><h4>What is the best time to go on safari?</h4><p>The dry season (June to October) is ideal for wildlife viewing as animals gather around water sources. However, each season offers unique experiences.</p><h4>What should I pack for a safari?</h4><p>Essential items include neutral-colored clothing, comfortable walking shoes, sunscreen, insect repellent, binoculars, and a camera. We provide a detailed packing list upon booking.</p><h4>Are safaris suitable for children?</h4><p>Yes! We offer family-friendly safaris designed for travelers with children. Age restrictions may apply for certain activities.</p><h3>Health &amp; Safety</h3><h4>Do I need vaccinations?</h4><p>Some destinations require proof of Yellow Fever vaccination. We recommend consulting with a travel health clinic for up-to-date advice on required and recommended vaccinations.</p><h4>Is it safe to go on safari?</h4><p>Safari travel is generally very safe when booked with reputable operators like us. Our experienced guides prioritize your safety at all times.</p><h3>Logistics</h3><h4>Do you arrange airport transfers?</h4><p>Yes, airport transfers are included in most of our packages. We can also arrange transfers for custom itineraries.</p><h4>What type of accommodation do you offer?</h4><p>We offer a range of accommodations from luxury lodges and tented camps to mid-range options, depending on your preferences and budget.</p>', 'Find answers to common questions about our safari tours and services.', NULL, 'FAQ - Frequently Asked Questions', 'Find answers to frequently asked questions about safari bookings, travel, payments, and more.', 'FAQ, frequently asked questions, safari questions, travel questions', 'default', 'tourism', 'published', 4, 1, 0, '2025-12-08 07:43:18', '2026-01-02 09:44:32'),
(5, '505685d2-71aa-42c5-bf1e-2c8ac0930cfd', 'HELLOW SKULL', 'hellow-skull', '<p>Hello skull today, back you you</p>', 'Hello skull today, back you you', 'b444a9c7f9cfe8d3ed37711f0f52f5dc.png', '', '', '', 'default', 'college', 'draft', 0, 1, 0, '2026-01-02 09:54:20', '2026-01-02 09:54:44');
