(1, '74f5c2de-e7e6-11f0-af6c-abc1c4959d53', 'college', 'faculty', 1, 'John Smith', 'john@example.com', 5, 'Excellent teaching methodology', 'Prof. Chen is very knowledgeable and makes complex topics easy to understand. Great lectures and always available for office hours.', 'rejected', '2026-01-02 13:40:27', '2026-01-02 15:18:35', NULL, NULL),
(2, '74f5ce1d-e7e6-11f0-af6c-abc1c4959d53', 'college', 'faculty', 1, 'Sarah Johnson', 'sarah@example.com', 4, 'Very inspiring and engaging professor', 'Great insights into real-world applications. The assignments are challenging but help reinforce the concepts effectively.', 'approved', '2026-01-02 13:40:27', '2026-01-02 14:22:11', NULL, NULL),
(3, '74f5cf57-e7e6-11f0-af6c-abc1c4959d53', 'college', 'faculty', 1, 'Michael Davis', 'michael@example.com', 5, 'Highly recommended for all students', 'One of the best professors in the department. Very organized, passionate about the subject, and truly cares about student success.', 'approved', '2026-01-02 13:40:27', '2026-01-02 14:22:11', NULL, NULL),
(4, '74f5d0be-e7e6-11f0-af6c-abc1c4959d53', 'college', 'faculty', 2, 'Emily White', 'emily@example.com', 4, 'Great explanation of complex concepts', 'Professor Clark explains mathematics in a way that makes sense. Highly recommended for anyone struggling with math.', 'approved', '2026-01-02 13:40:27', '2026-01-02 14:22:11', NULL, NULL),
(5, '74f5d126-e7e6-11f0-af6c-abc1c4959d53', 'college', 'faculty', 3, 'David Brown', 'david@example.com', 5, 'Outstanding business professor', 'Jennifer Davis brings real-world experience to the classroom. Her business case studies are invaluable for understanding strategy.', 'approved', '2026-01-02 13:40:27', '2026-01-02 14:22:11', NULL, NULL),
(7, '4cdfce25-e7ef-11f0-af6c-abc1c4959d53', 'college', 'faculty', 5, 'Lee lesdd', 'email@gmail.com', 5, 'HAHAHHAHA', 'Minimum 20 characters, maximum 5000', 'approved', '2026-01-02 15:25:29', '2026-01-03 05:40:21', '127.0.0.1', NULL);
