INSERT INTO `safari_destinations` (`id`, `uid`, `name`, `slug`, `country`, `description`, `short_description`, `rating`, `badge_text`, `badge_icon`, `badge_class`, `badge_label`, `location_label`, `duration_label`, `headline`, `intro_text`, `full_description`, `how_to_get_there`, `wildlife_text`, `activities_text`, `best_time_note`, `area_size`, `featured_image`, `best_time`, `highlights`, `activities`, `gallery`, `stats`, `seo_title`, `seo_description`, `is_active`, `is_featured`, `display_order`, `created_at`, `updated_at`) VALUES
(1, 'de1eaadb-3fe3-4dd3-b33e-843bcf89fb5e', 'Serengeti National Park', 'serengeti-national-park', 'Tanzania', 'The Serengeti is a vast ecosystem in northern Tanzania known for its diverse wildlife and the annual wildebeest migration. It covers approximately 30,000 square kilometers and is home to the Big Five.', 'Witness the Great Migration', '5.0', 'Most Popular', 'ð¦', 'badge-popular', NULL, 'Northern Tanzania', '3-5 Days', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'f2dbd7f847211c5489d552338916f2b9.jpg', 'June - October', NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, 2, '2025-12-05 19:36:27', '2025-12-06 00:59:35'),
(2, 'd5b6d588-6517-457e-8855-fe484bd8b047', 'Ngorongoro Crater', 'ngorongoro-conservation-area', 'Tanzania', 'The Ngorongoro Crater is a UNESCO World Heritage Site featuring the largest intact caldera on Earth. The crater is home to abundant wildlife including rhinos, lions, and buffalo within its protected ecosystem.', 'World\'s largest volcanic caldera', '4.8', 'Wildlife Haven', 'ð', 'badge-wildlife', NULL, 'Crater Highlands', '1-2 Days', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'fbf1e8d30a31522a44d5dd0f88e1110f.jpg', 'Year-round', NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, 3, '2025-12-05 19:36:27', '2025-12-06 00:59:11'),
(3, '5824fa5f-291e-4e50-9a59-f1df1fc47f42', 'Lake Natron', 'lake-natron', 'Tanzania', 'Lake Natron is known for its unique ecosystem and the striking pink-red coloration caused by algae and mineral-rich waters. It\'s a critical breeding ground for millions of flamingos.', 'Flamingo breeding grounds', '4.6', 'Flamingo Haven', 'ð¦©', '', NULL, 'Northern Tanzania', '1-2 Days', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'd2f8cef47f524b0a972da0a57a1fbfac.jpg', 'June - September', NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 6, '2025-12-05 19:36:27', '2025-12-06 00:58:14'),
(4, '56bc6309-49e6-4be6-a13b-302dcc2822e3', 'Tarangire National Park', 'tarangire-national-park', 'Tanzania', 'Tarangire is famous for its large elephant herds and baobab trees. The park is traversed by the Tarangire River and offers excellent game viewing opportunities with fewer crowds.', 'Ancient baobabs & elephant herds', '4.7', 'Elephant Paradise', 'ð', 'badge-wildlife', NULL, 'Northern Tanzania', '2-3 Days', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ea360c727cf73654375eabb7f793214c.jpg', 'June - October', NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 5, '2025-12-05 19:36:27', '2025-12-06 00:59:56'),
(5, '5a04dc1f-3389-4957-8fb0-053669f207b5', 'Mount Kilimanjaro', 'kilimanjaro-national-park', 'Tanzania', 'Africa\'s highest peak at 5,895 meters, Kilimanjaro attracts climbers and hikers from around the world. The mountain offers diverse ecosystems from rainforest to alpine meadows.', 'Roof of Africa - 5,895m Summit', '4.9', 'Adventure', 'ðï¸', 'badge-adventure', NULL, 'Northeastern TZ', '6-9 Days', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '9a26ad619ac4e5c2e51dafd743a2f1d4.jpg', 'July - September, January - February', NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, 4, '2025-12-05 19:36:27', '2025-12-06 00:58:33'),
(6, '54465306-8366-47ca-86a5-2dfbb5befd40', 'Zanzibar Archipelago', 'zanzibar', 'Tanzania', 'An exotic island paradise known for its pristine beaches, coral reefs, historic Stone Town, and rich Swahili culture. Perfect for relaxation and beach activities.', 'Crystal clear waters & pristine beaches', '4.9', 'Beach Paradise', 'ðï¸', '', NULL, 'Indian Ocean', '4-7 Days', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'd6ed1e31c317eabea676294a7c466239.jpg', 'June - October, February - March', NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, 1, '2025-12-05 19:36:27', '2025-12-06 01:00:16');
INSERT INTO `safari_packages` (`id`, `uid`, `name`, `slug`, `description`, `short_description`, `duration_days`, `duration_nights`, `category`, `difficulty`, `group_size_min`, `group_size_max`, `destinations`, `highlights`, `inclusions`, `exclusions`, `best_time`, `start_location`, `end_location`, `accommodation_type`, `image`, `gallery`, `is_active`, `is_featured`, `sort_order`, `meta_title`, `meta_description`, `created_at`, `updated_at`) VALUES
(1, 'ddd7-f03b-0fa3', '5 Days Safari Adventure', '5-days-safari-package', '<p>Experience the best of Tanzania with game drives in Serengeti, Ngorongoro Crater, and Tarangire. Witness the Big Five and explore diverse ecosystems.</p>', 'Discover Serengeti and Ngorongoro Crater in 5 unforgettable days', 5, 4, 'wildlife', 'easy', 2, 8, '[\"Serengeti\",\"Ngorongoro\",\"Tarangire\"]', '[\"Game drives in Serengeti National Park\", \"Explore Ngorongoro Crater\", \"Spot the Big Five\", \"Professional English-speaking guide\", \"Comfortable 4x4 safari vehicle\", \"All park fees included\"]', '[\"Airport transfers\", \"All park fees\", \"Accommodation as per itinerary\", \"4x4 Land Cruiser\", \"English-speaking guide\", \"All meals on safari\", \"Drinking water\", \"All taxes\"]', '[\"International flights\", \"Visa fees\", \"Travel insurance\", \"Tips\", \"Personal expenses\", \"Optional activities\", \"Alcoholic beverages\"]', 'June - October', 'Arusha', 'Arusha', 'Mid-range Lodge', '396279e612e5b86d3edb71f068c5bf9d.jpg', '[\"f4f8fdef7db4c961d9f3b8c7ef5ac162.jpg\",\"aa28c19e6b18bdd5368eab1d59e5c67f.jpg\",\"c0cc9e203c7c53e12ec852319174b74d.jpg\",\"3918071a87c737c180ba2ad4acad32a7.jpg\",\"4146a58dab3b2347b47ebb3da2397700.jpg\",\"ed4d1a7dd0eabf46ffd181bef8756b50.jpg\",\"932bf42be87210022ae660ad570766be.jpg\",\"60dfd79a741b8601af234ab933765fbb.jpg\",\"3893d68e1495319b3f155b613749a05e.jpg\",\"e8c510d1a691c2be7af76cde5ca54f00.jpg\"]', 1, 1, 1, '', '', '2025-12-05 09:11:30', '2025-12-05 22:11:45'),
(2, '7f0b-6ee0-a107', '6 Days Safari Adventure', '6-days-safari-package', 'Comprehensive northern Tanzania safari covering the iconic Serengeti, Ngorongoro Crater, and Lake Manyara. Perfect for wildlife enthusiasts.', 'Comprehensive Northern Tanzania safari with extended Serengeti exploration', 6, 5, 'wildlife', 'easy', 2, 8, '[\"Serengeti\", \"Ngorongoro\", \"Manyara\"]', '[\"Witness the Great Migration (seasonal)\", \"Explore Ngorongoro Crater - UNESCO World Heritage\", \"Spot the Big Five in their natural habitat\", \"Professional English-speaking guide\", \"Comfortable 4x4 safari vehicle\", \"All park fees and taxes included\"]', '[\"Airport pickup & drop-off\", \"All park fees\", \"All accommodation as per itinerary\", \"Private 4x4 Land Cruiser with pop-up roof\", \"Professional English-speaking guide\", \"All meals during safari\", \"Drinking water during game drives\", \"All taxes and government fees\"]', '[\"International flights\", \"Visa fees\", \"Travel insurance\", \"Tips and gratuities\", \"Personal expenses\", \"Optional activities (balloon safari)\", \"Alcoholic beverages\"]', 'June - October', 'Arusha', 'Arusha', 'Mid-range Lodge', 'destinations/osiram_safari_adventures_4x4_blue_car-01.jpg', NULL, 1, 1, 2, NULL, NULL, '2025-12-05 09:11:30', '2025-12-05 14:21:27'),
(3, '068d-3cf9-ccf7', '7 Days Great Migration Safari', '7-days-safari-package', 'Witness the world-famous Great Migration in Serengeti. Includes hot air balloon safari option and luxury camp accommodations.', 'Witness the Great Migration with extended game viewing', 7, 6, 'wildlife', 'easy', 2, 8, '[\"Serengeti\", \"Ngorongoro\", \"Tarangire\"]', '[\"Tarangire National Park - Land of Giants\", \"Serengeti National Park - Great Migration\", \"Ngorongoro Crater - 8th Wonder of the World\", \"Professional guide throughout\", \"Comfortable accommodations\", \"All-inclusive safari experience\"]', '[\"Airport transfers\", \"All park fees\", \"All accommodations\", \"4x4 vehicle\", \"Guide\", \"All meals\", \"Water\", \"Taxes\"]', '[\"Flights\", \"Visa\", \"Insurance\", \"Tips\", \"Personal items\", \"Optional activities\", \"Alcohol\"]', 'June - October', 'Arusha', 'Arusha', 'Mid-range Lodge', 'destinations/osiram_safari_adventure_great_migration-01.jpg', NULL, 1, 1, 3, NULL, NULL, '2025-12-05 09:11:30', '2025-12-05 14:21:27'),
(4, 'ac1e-34fe-422a', '9 Days Safari & Beach Escape', '9-days-safari-package', 'The perfect combination of thrilling wildlife safari and relaxing beach vacation. Explore Serengeti and unwind in Zanzibar paradise.', 'Wildlife safari combined with Zanzibar beach paradise', 9, 8, 'beach', 'easy', 2, 6, '[\"Serengeti\", \"Ngorongoro\", \"Zanzibar\"]', '[\"Wildlife Safari in Serengeti\", \"Ngorongoro Crater exploration\", \"Zanzibar Beach Resort\", \"Stone Town cultural tour\", \"Snorkeling and water activities\", \"Complete relaxation\"]', '[\"All transfers\", \"Domestic flight to Zanzibar\", \"All park fees\", \"All accommodations\", \"Safari meals\", \"Guide\", \"Beach activities\"]', '[\"International flights\", \"Visa\", \"Insurance\", \"Tips\", \"Personal expenses\", \"Alcoholic beverages\"]', 'Year-round', 'Arusha', 'Zanzibar', 'Luxury Lodge', 'destinations/osiram_safari_adventure_zanzibar-01.jpg', NULL, 1, 1, 4, NULL, NULL, '2025-12-05 09:11:30', '2025-12-05 14:21:27'),
(5, '8ca6-8b91-ecf1', '10 Days Cultural Safari Adventure', '10-days-safari-package', '<p>Immerse yourself in Maasai culture while experiencing the best wildlife viewing. Includes village visits, traditional dances, and walking safaris.</p>', 'Deep cultural immersion with world-class wildlife viewing', 10, 9, 'cultural', 'moderate', 2, 8, '[\"Serengeti\",\"Maasai Village\",\"Ngorongoro\"]', '[\"Maasai Village cultural experience\", \"Traditional dance performances\", \"Walking safari with Maasai warriors\", \"Big Five wildlife viewing\", \"Authentic local cuisine\", \"Photography opportunities\"]', '[\"All transfers\", \"All park fees\", \"Accommodations\", \"Cultural visits\", \"Maasai guide\", \"All meals\", \"Water\"]', '[\"Flights\", \"Visa\", \"Insurance\", \"Tips\", \"Personal items\", \"Alcohol\"]', 'Year-round', 'Arusha', 'Arusha', 'Mid-range Lodge', 'f6325c4cbd0f45d457429654af745209.jpg', '[\"8ad65e799391ddb820936bef41a6647d.jpg\",\"ee61a5232559eae65cfbd8922a47bf0f.jpg\",\"13b698b297c805d7765fd3ab9f3c7df8.jpg\",\"1717309e323c42ce413db76536a20c8d.jpg\",\"3accbad208d9298f72726014f8c12f28.jpg\",\"e7d606519629383147b4721c84189974.jpg\",\"901ade509a194af764344b7ed3a67945.jpg\",\"7739000343ef5e94474cf8aad90b6b9f.jpg\"]', 1, 1, 5, '', '', '2025-12-05 09:11:30', '2025-12-05 15:51:12'),
(6, 'c1f0-31a5-42ae', '14 Days Ultimate Tanzania Experience', '14-days-safari-package', 'The complete Tanzania adventure covering all major parks, Kilimanjaro views, and Zanzibar beaches. Luxury accommodations throughout.', 'Complete Tanzania experience with all major highlights', 14, 13, 'luxury', 'moderate', 2, 6, '[\"All Parks\", \"Kilimanjaro\", \"Zanzibar\"]', '[\"All major Northern Circuit parks\", \"Extended Serengeti stay\", \"Kilimanjaro day hike\", \"Zanzibar beach holiday\", \"Cultural experiences\", \"Top luxury lodges\", \"Complete Tanzania experience\"]', '[\"All transfers and flights\", \"All park fees\", \"Luxury accommodations\", \"Private guide\", \"All meals\", \"Exclusive experiences\"]', '[\"International flights\", \"Visa\", \"Insurance\", \"Tips\", \"Personal items\"]', 'Year-round', 'Arusha', 'Zanzibar', 'Luxury Lodge', 'destinations/osiram_safari_adventure_14_days_package-01.jpg', NULL, 1, 1, 6, NULL, NULL, '2025-12-05 09:11:30', '2025-12-05 14:21:27'),
(7, '941f-dee2-72e5', '3 Days Ngorongoro Budget Safari', '3-days-budget-safari', 'Affordable camping safari to the magnificent Ngorongoro Crater. See the Big Five in the world largest unflooded caldera.', 'Affordable crater safari with camping experience', 3, 2, 'budget', 'easy', 2, 12, '[\"Ngorongoro\", \"Maasai Village\"]', '[\"Ngorongoro Crater game drive\", \"Big Five sighting opportunities\", \"Camping experience\", \"Maasai village visit\", \"All meals included\", \"Budget-friendly price\"]', '[\"Camping gear\", \"Park fees\", \"Meals\", \"Guide\", \"Vehicle\", \"Water\"]', '[\"Flights\", \"Visa\", \"Insurance\", \"Tips\", \"Personal items\", \"Alcohol\"]', 'Year-round', 'Arusha', 'Arusha', 'Camping', 'ngorongoro.jpg', NULL, 1, 0, 7, NULL, NULL, '2025-12-05 09:11:30', '2025-12-05 14:21:27'),
(8, '6105-b98e-2456', '4 Days Manyara & Tarangire Safari', '4-days-budget-safari', 'Budget-friendly safari featuring elephant herds in Tarangire and tree-climbing lions in Lake Manyara. Camping accommodation included.', 'Elephants and tree-climbing lions on a budget', 4, 3, 'budget', 'easy', 2, 12, '[\"Lake Manyara\", \"Tarangire\"]', '[\"Tarangire elephant herds\", \"Lake Manyara tree-climbing lions\", \"Flamingo sightings\", \"Camping experience\", \"All meals included\", \"Great value safari\"]', '[\"Camping gear\", \"Park fees\", \"All meals\", \"Guide\", \"Vehicle\", \"Water\"]', '[\"Flights\", \"Visa\", \"Insurance\", \"Tips\", \"Personal items\", \"Alcohol\"]', 'Year-round', 'Arusha', 'Arusha', 'Camping', 'destinations/osiram_safari_adventure_elephant-01.jpg', NULL, 1, 0, 8, NULL, NULL, '2025-12-05 09:11:30', '2025-12-05 14:21:27'),
(9, '3ca9-8a7d-686f', '7 Days Kilimanjaro Machame Route', 'kilimanjaro-machame-7-days', '<p>Climb Africa highest peak via the scenic Machame Route. Expert guides, all equipment, and 98% success rate guaranteed.</p>', 'Summit Africa\'s highest peak via the scenic route', 7, 6, 'mountain', 'challenging', 2, 8, '[\"Mt. Kilimanjaro\",\"Uhuru Peak\"]', '[\"98% summit success rate\", \"Experienced mountain guides\", \"All climbing equipment\", \"Proper acclimatization schedule\", \"Stunning varied scenery\", \"Certificate of achievement\"]', '[\"All climbing permits\", \"Mountain guides and porters\", \"All equipment\", \"Meals on mountain\", \"Accommodation\", \"Transfers\"]', '[\"Flights\", \"Visa\", \"Insurance\", \"Tips for guides/porters\", \"Personal gear\", \"Drinks\"]', 'January - March, June - October', 'Moshi', 'Moshi', 'Mountain Camps', 'kilimanjaro.jpg', '[]', 1, 0, 9, '7 Days Kilimanjaro Machame Route', 'Summit Africa\'s highest peak via the scenic route', '2025-12-05 09:11:30', '2025-12-16 14:44:53');
